import React from 'react';
import { Link } from 'react-router-dom';
import logo from "../images/download.png"

const Navbar = () => {
  return (
    <>
      <nav className="navbar bg-body-tertiary">
  <div className="container-fluid">

    <img src={logo} alt="Logo" width="50" height="60" className="d-inline-block align-text-top"/>
   <span>
    <Link to="" className='px-3'>Popular</Link>
    <Link to="" className='px-3'>Upcoming</Link>
    <Link to="" className='px-3'>Top Rated</Link>
  </span>
   

  </div>
  <form class="form-inline">
    <input class="form-control mr-sm-4" type="search" placeholder="Search" aria-label="Search"/>
    <button class="btn btn-outline-success" type="submit">Search</button>
  </form>
</nav>
    </>
  );
}

export default Navbar;
